import React from "react";
import "../src/main-css/main.css"; // Make sure to adjust the path if needed
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebook, faTwitter, faGoogle, faLinkedin, faYoutube, faSquareXTwitter } from '@fortawesome/free-brands-svg-icons';

export default function Stickybar() {
  return ( 
    <div className="icon-bar">
      <a href="#" className="facebook"><FontAwesomeIcon icon={faFacebook} /></a> 
      <a href="#" className="twitter"><FontAwesomeIcon icon={faSquareXTwitter} /></a> 
      <a href="#" className="google"><FontAwesomeIcon icon={faGoogle} /></a> 
      <a href="#" className="linkedin"><FontAwesomeIcon icon={faLinkedin} /></a>
      <a href="#" className="youtube"><FontAwesomeIcon icon={faYoutube} /></a> 
    </div>
  );
}
